import './index.css'

import React from 'react'
import {ReactDOM }from 'react-dom'
import {Route, Switch, BrowserRouter} from 'react-router-dom';
import Root from './components/root/Root';

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <Root/>
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);
